  constructor(){
    super();
    this.state = {
      posts: Array()
    }
  }




  render() {
    return (
      <div className="body">
      <h1>Calcolatrice</h1>
      <Post result={this.state.posts[0]}/>
      </div>
    );
  }
}

export default App;
